import logo from './logo.png';
import './App.css';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom'; // Update this line
import SignIn from './SignIn';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          SmartEats Application
        </p>
        <nav>
            <ul>
              <li><Link to="/signin" className="App-link">Sign In</Link></li>
              <li><Link to="/signup" className="App-link">Sign Up</Link></li>
            </ul>
          </nav>
          <Routes> {/* Updated from Switch to Routes */}
            <Route path="/signin" element={<SignIn />} /> 
            <Route path="/signup" element={<SignUp />} />
          </Routes>
      </header>
    </div>
  );
}

export default App;
